  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents both San Francisco
  and Los Angeles District navigation channel lines. All San Francisco District channel
  lines were digitized from CAD files provided by the Hydrosurvey Group, some files
  were collected from local project folders. Los Angeles District channel lines were
  derived from polygons of varying quality, not from a consistent or reliable source.
  This dataset only includes USACE maintained navigation channels. Feature level metadata
  is available by request.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
